import React from 'react';
import ReactDom from 'react-dom';
import { HashRouter as Router, Route, Link, NavLink } from 'react-router-dom';
import './index.css';



class App extends React.Component{
    render(){
    return(
        <div className="App">
        <div className="App__Aside"></div>

        <div className="App__Form">

        <form className="FormTitle">
        <Router>
         <div className="PageSwitcher">
                <NavLink to="/sign-in" activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item">Sign In</NavLink>
                <NavLink exact to="/" activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item">Sign Up</NavLink>
              </div> 
        </Router>

        <Route exact path="/" component={SignUpForm}>
              </Route>
        <h2 >Create Your Account</h2>

        <p><input required placeholder="Registration Number"type="" className="form-control"></input></p>


        <p><input required placeholder="Chasis Number" type="" className="form-control"></input></p>


        <p><input required placeholder="Username" className="form-control"></input></p>


        <p>
        
        <input  required placeholder="Email" type="Email" className="form-control"  ></input>
        </p>
        
        
        <p><input required placeholder="Password" type="Password" className="form-control"></input></p>


        <p><input required placeholder="Confirm Password" type="Password" className="form-control"></input></p>

        <input type="Submit" value="Create Account" class="btn btn-primary btn-lg btn-block"></input>


        
        </form> 
        
        
        </div>
        </div>
    );

    };
};











ReactDom.render(<App />,document.querySelector('#root'));
